import React, { useState, useEffect } from 'react';
import '../App.css';
import { useGlobalContext } from '../components/GlobalContext';
import axios from 'axios'


function Profile() {
  //   const [inputValueFromForm, setInputValueFromForm] = useState('');
  const { googleID, updateGoogleID } = useGlobalContext();
  const [records, setRecords] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);



  //   const handleFormSubmit = (value) => {
  //     setInputValueFromForm(value);
  //     processGuess(value)
  //   };
  function displayBooksByGoogleId() {
    axios.get('https://wheeloffortune-game.wl.r.appspot.com/game/findByGoogleId' + '?googleId=' + googleID)
      .then(response => {
        setRecords(response.data);  // Axios packs the response in a 'data' property
        setLoading(false);
        console.log(response.data)
      })
      .catch(error => {
        setError(error.message);
        setLoading(false);
      });

  };
  useEffect(() => {
    displayBooksByGoogleId();
}, []);

  return (
    <div className="Profile">

      <div>Profile</div>
      <div>{googleID}</div>
      <div>
      <h2>Scores</h2>
      <table style={{ width: '100%', borderCollapse: 'collapse', marginTop: '20px' }}>
        <thead>
          <tr>
            <th>ID</th>
            <th>Google ID</th>
            <th>Score</th>
            <th>Timestamp</th>
          </tr>
        </thead>
        <tbody>
          {records.map((score) => (
            <tr key={score.id}>
              <td>{score.id}</td>
              <td>{score.googleId}</td>
              <td>{score.score}</td>
              <td>{score.timestamp}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
    </div>
  );
}

export default Profile;
